	add("apogee", "{\"term\":\"apogee\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French {{m|fr|apogée}}, from Latin {{m|la|apogaeum}}, {{m|la|apogeum}}, from Ancient greek (to 1453) {{m|grc|ἀπόγειον||away from Earth}}, from {{m|grc|ἀπό||away}} + {{m|grc|γῆ||Earth}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The point, in an orbit about the Earth, that is furthest from the Earth: the apoapsis of an Earth orbiter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The point, in an orbit about any planet, that is farthest from the planet: the apoapsis of any satellite\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, John H. Rogers, \u0027The Giant Planet Jupiter\u0027, Cambridge University Press, ISBN 978-0-521-41008-3, [http://books.google.com/books?id\u003dSO48AAAAIAAJ\u0026amp;pg\u003dPA335\u0026amp;dq\u003dperigee page 335\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Conjunctions of I and II [Io and Europa] occur when they are near perigee and \u0027\u0027apogee\u0027\u0027 respectively; conjunctions of II and III [Europa and Ganymede] occur when II [Europa] is near perigee\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Serge Brunier, \u0027Solar System Voyage\u0027, Cambridge University Press, ISBN 978-0-521-80724-1, [http://books.google.com/books?id\u003dJkLxJOhEj-wC\u0026amp;pg\u003dPA36\u0026amp;dq\u003dperigee page 36\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The resolution of the images obtained by this American probe [Messenger] will depend on its altitude [above Mercury] at any one time: about ten meters at perigee (200km altitude), but only one 1 km at \u0027\u0027apogee\u0027\u0027 (15000km\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Ruth Walker and Mary M. Shaffrey et al., \u0027Exploring Space: The High Frontier\u0027, Jones \u0026amp; Bartlett Learning, ISBN 978-0-7637-8961-9, [http://books.google.com/books?id\u003d7Ux61eRFS_YC\u0026amp;pg\u003dPA129\u0026amp;dq\u003dperigee page 129\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Nereid’s] \u0027\u0027apogee\u0027\u0027—farthest point from Neptune—is five times the distance of its perigee—its closest point\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The point, in any trajectory of an object in space, where it is furthest from the Earth\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The highest point\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 March 22, \u0027w:The New The New Yorker\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The cult of the chief executive reached its \u0027\u0027apogee\u0027\u0027 in the nineteen-nineties, a period when C.E.O.s seemed not so much to serve their companies as to embody them\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"date\u003d15 September passage\u003dThe \u0027\u0027apogee\u0027\u0027 of w:Ming Ming China came in the half century following his [the \u0027s] death. Of this period, the initial two decades were dominated by his son, the w:Yongle Yongle emperor (1360–1424), who was a much more successful Oriental version of w:Richard III of Richard III\", \"priority\":13}]}, \"synonyms\":{}}");

	add("apograph", "{\"term\":\"apograph\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀπόγραφον\u0027 from \u0027ἀπογράφω\u0027 (i copy) from \u0027ἀπό\u0027 (off, away from) + \u0027γράφω\u0027 (write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A perfect copy, an exact transcript\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1962\u0027\u0027, w:Vladimir Vladimir Nabokov, \u0027w:Pale Pale Fire\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Moreover, this is not a holograph but an \u0027\u0027apograph\u0027\u0027, made by a scribe for the printers – you will note that both mayors write the same hand\", \"priority\":3}]}, \"synonyms\":{}}");

