	add("apologia", "{\"term\":\"apologia\", \"etymology\":{\"influencers\":[], \"languages\":[\"ancient greek (to 1453)\", \"Italian\"], \"text\":\"Ancient greek (to 1453) {{suffix||logia|lang\u003dit}}{{wikipedia|lang\u003dit}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A written defense of a position or belief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Although I\u0027ve enumerated some of the academic traditions and debates that have animated this book, it is not my purpose to offer a full \u0027\u0027apologia\u0027\u0027 in these brief pages.\u0027 - 1999 Preface from \u0026quot;Gender Trouble\u0026quot; by Judith Butler\", \"priority\":2}]}, \"synonyms\":{}}");

