	add("apology", "{\"term\":\"apology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027apologie\u0027 from \u0027\u0027 from Ancient greek (to 1453) \u0027ἀπολογία\u0027 (a speech in defence) from \u0027ἀπολογοῦμαι\u0027 (i speak in one\u0027s defense) from \u0027ἀπόλογος\u0027 (an account, story) from \u0027ἀπό\u0027 (from, off) (see \u0027apo-\u0027) + \u0027λόγος\u0027 (speech)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An expression of remorse or regret for having said or done something that harmed another: an instance of apologizing (saying that one is sorry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"What he said really hurt my feelings, but his \u0027\u0027apology\u0027\u0027 sounded so sincere that I couldn\u0027t help but forgive him\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The CEO made a public \u0027\u0027apology\u0027\u0027 for the scandal, and promised full cooperation with the authorities\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A formal justification, defence\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Apology of Socrates\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Anything provided as a substitute; a makeshift\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a poor \u0027\u0027apology\u0027\u0027 for a hotel room\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Charles Dicken\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"He goes to work devising \u0027\u0027apologies\u0027\u0027 for window curtains\", \"priority\":9}]}, \"synonyms\":{}}");

