	add("apoplexy", "{\"term\":\"apoplexy\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"Old english (ca. 450-1100) \u0027poplexye\u0027 \u0027poplexia\u0027 \u0027apoplexia\u0027 from Ancient greek (to 1453) \u0027ἀποπληξία\u0027 from \u0027ἀποπλήσσειν\u0027 to cripple by a stroke; \u0027ἀπό\u0027 (from) + \u0027πλήσσειν\u0027 (to strike) compare with French \u0027apoplexie\u0027 See \u0027plague\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Bleeding within internal organs and the accompanying symptoms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sudden diminution or loss of consciousness, sensation, and voluntary motion, usually caused by pressure on the brain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Great anger and excitement\", \"priority\":3}]}, \"synonyms\":{}}");

