	add("apoptosis", "{\"term\":\"apoptosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀπόπτωσις\u0027 (a falling off) from \u0027ἀπό\u0027 (away from) + \u0027πτῶσις\u0027 (falling)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process of programmed cell death by which cells undergo an ordered sequence of events which lead to death of the cell, as occurs during growth and development of the organism, as a part of normal cell aging, or as a response to cellular injury\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, John F Kerr et al., (title\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Apoptosis\u0027\u0027: a basic biological phenomenon with wide-ranging implications in tissue kinetics\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027Genome\u0027, Harper Perennial 2004, p. 238\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Indeed, so important is \u0027\u0027apoptosis\u0027\u0027 that it is gradually becoming clear that almost all therapeutic cancer treatment works only because it induces \u0027\u0027apoptosis\u0027\u0027 by alerting p53 and its colleagues\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Terence Allen and Graham Cowling, \u0027The Cell: A Very Short Introduction\u0027, Oxford 2011, p. 74\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Apoptosis\u0027\u0027 is routine in developmental processes such as the removal of webbing between fingers in humans, the loss of tadpole tails in amphibians, and insect metamorphosis\", \"priority\":7}]}, \"synonyms\":{}}");

	add("aporesis", "{\"term\":\"aporesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Knowing perplexity, knowing the extent of one\u0027s wisdom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("aporia", "{\"term\":\"aporia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027aporia\u0027 from Ancient greek (to 1453) \u0027ἀπορία\u0027 from \u0027ἄπορος\u0027 (impassable) from \u0027ἀ-\u0027 (a-) + \u0027πόρος\u0027 (passage)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An expression of deliberation with oneself regarding uncertainty or doubt as to how to proceed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, ‘Text Messenger’, \u0027Literary Review\u0027 404\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Meanings are superposed in an \u0027\u0027aporia\u0027\u0027 – not ‘either/or’, but ‘and/and’\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An insoluble contradiction in a text\u0027s meaning; a logical impasse suggested by a text or speaker\", \"priority\":4}]}, \"synonyms\":{}}");

	add("aposematism", "{\"term\":\"aposematism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|apo|alt2\u003dsemat(ic)|sematic|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An adaptation that warns off potential predators; especially such a warning colouration\", \"priority\":1}]}, \"synonyms\":{}}");

	add("aposiopesis", "{\"term\":\"aposiopesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|aposiopesis}}, from Ancient greek (to 1453) \u0027ἀποσιώπησις\u0027 from \u0027ἀποσιωπάω\u0027 (lang\u003dgrc) from \u0027ἀπό\u0027 (off, from) + \u0027σιωπάω\u0027 (to be silent)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abrupt breaking-off in speech\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apostasy", "{\"term\":\"apostasy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027apostasia\u0027 from Ancient greek (to 1453) \u0027ἀποστασία\u0027 (defection, revolt) from \u0027ἀφίστημι\u0027 (i withdraw, revolt) from \u0027ἀπό\u0027 (from) + \u0027ἵστημι\u0027 (i stand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The renunciation of a belief or set of beliefs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027, James Anthony Froude, \u0027History of England from the Fall of Wolsey to the Death of Elizabeth\u0027, page 39\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The King of Navarre suddenly abandoned his party and went over to the Catholics. The explanation of his \u0027\u0027apostasy\u0027\u0027 was as simple as it was base: Navarre had no confidence in the success of his cause, and he cared little in his heart for anything but women and vanity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, w:Henry Henry James, \u0027The Princess Casamassima\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"What had he said, what had he done, after all, to give them the right to fasten on him the charge of \u0027\u0027apostasy\u0027\u0027? He had always been a free critic of everything, and it was natural that, on certain occasions, in the little parlour in Lisson Grove, he should have spoken in accordance with that freedom; but it was only with the Princess that he had permitted himself really to rail at the democracy and given the full measure of his scepticism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the renunciation of one\u0027s religion or faith\", \"priority\":6}]}, \"synonyms\":{}}");

	add("apostlehood", "{\"term\":\"apostlehood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|apostle|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being an apostle\", \"priority\":1}]}, \"synonyms\":{}}");

