	add("apostolicism", "{\"term\":\"apostolicism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being apostolical; apostolicity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apostolicity", "{\"term\":\"apostolicity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From {{suffix|apostolic|ity|lang\u003den}}, after French \u0027apostolicité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being apostolic, notably of preserving authenticity within the mission and tradition of the Christian church as founded by Jesus Christ and his twelve original Apostles, through their representatives and successors in the papacy and episcopate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 427\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"his Church did its best to trump Rome in \u0027\u0027apostolicity\u0027\u0027 by declaring that it had been founded by the first-recruited among Christ\u0027s Apostles, Andrew\", \"priority\":3}]}, \"synonyms\":{}}");

	add("apostolicness", "{\"term\":\"apostolicness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being apostolic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apotemnophilia", "{\"term\":\"apotemnophilia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined in a 1977 paper by J. Money et al. in the \u0027Journal of Sex Research,\u0027[http://www.jstor.org/pss/3811894], from Ancient greek (to 1453) \u0027ἀπό\u0027 (away) + \u0027τέμνω\u0027 (cut) {{suffix||philia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A compulsion to become, or appear to be, an amputee\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apotemnophobia", "{\"term\":\"apotemnophobia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027απο\u0027 + \u0027τέμνω\u0027 (cut) {{suffix||phobia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fear of amputation (afraid that one will lose appendages), fear of amputations (fear of amputations on others), fear of amputees (persons with amputations\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apothecary", "{\"term\":\"apothecary\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027apotecaire\u0027 from \u0027apothecarius\u0027 (storekeeper) from \u0027lang\u003dla|apotheca\u0027 () earlier Latin \u0027lang\u003dla|apotheca\u0027 () from Ancient greek (to 1453) \u0027lang\u003dgrc|ἀποθήκη\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who makes and provides/sells drugs and/or medicines\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"scene 3 (First Folio ed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"O true \u0027\u0027Apothecarie\u0027\u0027!\u0026lt;br/\u0026gt;Thy drugs are quicke. Thus with a kiſſe I die\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A drugstore or pharmacy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, S.A., “Pharmacy in Russia”, in \u0027Soviet Russia\u0027, volume 1, number 27, [http://books.google.com/books?id\u003dElVGAAAAMAAJ\u0026amp;pg\u003dRA12-PA6\u0026amp;dq\u003dapothecary page 6\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Russian people as a whole almost revered the \u0027\u0027apothecary\u0027\u0027, and they entered it as they would enter a sanctum\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Karen Holliday Tanner, \u0027Doc Holliday: A Family Portrait\u0027, University of Oklahoma Press (2001), ISBN 978-0-8061-3320-1, [http://books.google.com/books?id\u003dO9GXyeUpDaIC\u0026amp;pg\u003dPA205\u0026amp;dq\u003dapothecary pages 205–206\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He was befriended by a local druggist, Jay Miller, who worked at the \u0027\u0027apothecary\u0027\u0027 at the corner of Sixth and Harrison Street\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Audrey Horning, “Archeology and the Science of Discovery”, in Barbara Heath et al., \u0027Jamestown Archeological Assessment\u0027, U.S. National Parks Service, [http://books.google.com/books?id\u003dDLWVFHB4sfsC\u0026amp;pg\u003dPA31\u0026amp;dq\u003dapothecary page 31\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Seeds found in a 1630s refuse-filled clay borrow pit, located near an \u0027\u0027apothecary\u0027\u0027, illustrate colonists \u0026lt;!-- no apostrophe --\u0026gt; intense interest in experimenting with the medicinal qualities of New World plants\", \"priority\":10}]}, \"synonyms\":{}}");

	add("apotheosis", "{\"term\":\"apotheosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|apotheōsis}}, from Ancient greek (to 1453) {{m|grc|ἀποθέωσις}}, from verb {{m|grc|ἀποθεόω||deify}} (factitive verb formed from {{m|grc|θεός||God}} with intensive prefix {{m|grc|ἀπο-}}) + {{m|grc|-σις||forms noun of action}}. Surface analysis {{confix|apo|theo-|sis|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact or action of becoming or making into a god; deification\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, SRF Price, \u0027Rituals and Power\u0027, p. 75\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In Rome itself the official position was clear: the \u0027\u0027apotheosis\u0027\u0027 of the emperor took place only after his death; this had to be officially recognized by the Senate, and only then did the emperor become a \u0027divus\u0027 with an official cult\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, CE Newlands, \u0027Statius\u0027 Silvae and the Politics of Empire\u0027, p. 176\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As a former mortal who underwent \u0027\u0027apotheosis\u0027\u0027, Hercules was important to the emperors\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Glorification, exaltation; crediting someone or something with extraordinary power or status\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dIn the eyes of Mr. Farquhar Fenelon Cooke the \u0027\u0027apotheosis\u0027\u0027 of the Celebrity was complete. The people of Asquith were not only willing to attend the house-warming, but had been worked up to the pitch of eagerness. The Celebrity as a matter of course was master of ceremonies\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Per Lord Hailsham, \u0027\u0027Smedleys Ltd v Breed [1974]2 All ER 21(HL) at 24\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Thereafter, the caterpillar achieved a sort of posthumous \u0027\u0027apotheosis\u0027\u0027. From local authority to the Dorchester magistrates, from the Dorchester magistrates to a Divisional Court presided over by the Lord Chief Justice of England, from the Lord Chief Justice to the House of Lords, the immolated insect has at length plodded its methodical way to the highest tribunal in the land\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A glorified example or ideal; the apex or pinnacle (of a concept or belief\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1925\u0027\u0027, \u0027\u0027, \u0027In The American Grain\u0027, 1990, p. 232\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In his despair he had nowhere to turn. It is the very \u0027\u0027apotheosis\u0027\u0027 of the place and the time\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The best moment or highest point in the development of something, for example of a life or career; the apex, culmination, or climax (of a development\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Loosely, release from earthly life, ascension to heaven; death\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Bear thee grimly, demigod! Up from the spray of thy ocean-perishing — straight up, leaps thy \u0027\u0027apotheosis\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The latent entity that mediates between a person\u0027s psyche and their thoughts. The id, ego and superego in Freudian Psychology are examples of this\", \"priority\":16}]}, \"synonyms\":{}}");

